import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter, Router, Route } from 'react-router-dom';
import './App.css';
import Home from './Pages/Home';

function App() {
  return (
    <BrowserRouter>
      <Router>
        <Route path="/" Component={<Home />}/>
      </Router>
    </BrowserRouter>
  );
}

export default App;
